.hide_label_ar .frm_primary_label{
	display:none !important;
}

.row_bottom_border_hs2n {
	    border-bottom: solid 2px #cccccc;
    padding-bottom: 5px
}
@media only screen and (max-width: 600px) {
    .newrowbreak {
        border-top: solid 1px #000;
    }
}

.add-bottom-marg {
	margin-bottom:30px;
}

.with_frm_style .chosen-container .chosen-results li.highlighted {background-color: #639328;
    background-image: -webkit-gradient(linear, left top, left bottom, color-stop(20%, #639328), color-stop(90%, #639328));
    background-image: linear-gradient(#639328 20%, #639328 90%);
    color: #fff !important;
}


.masonry {
    margin: 1.5em 0;
    padding: 0;
    -moz-column-gap: 1.5em;
    -webkit-column-gap: 1.5em;
    column-gap: 1.5em;
    font-size: .85em;
}



@media only screen and (min-width: 600px) {
    .masonry {
        -moz-column-count: 2;
        -webkit-column-count: 2;
        column-count: 2;
    }
}

@media only screen and (min-width: 1100px) {
    .masonry {
        -moz-column-count: 3;
        -webkit-column-count: 3;
        column-count: 3;
    }
}

.arup_add_remove {
  margin-top:2em;
}

.timesheet_supplier .chosen-results li, .chosen-container .chosen-results li span {
